cumin, a compound in turmeric,\\u00a0<a class=\\\"content-link\\\" style=\\\"color: #ffffff;\\\" href=\\\"https:\\/\\/www.ncbi.nlm.nih.gov\\/pmc\\/articles\\/PMC3400101\\/\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">may reduce inflammation in the body.<\\/a><\\/span><\\/p><h1><span style=\\\"color: #e8ebeb;\\\">4. Spices may even help fight cancer cells<\\/span><\\/h1><p><span style=\\\"color: #ffffff;\\\">Capsaicin, an active component of chili peppers, has been shown to slow and destroy cancer cells. A\\u00a0<a class=\\\"content-link\\\" style=\\\"color: #ffffff;\\\" href=\\\"http:\\/\\/cancerres.aacrjournals.org\\/content\\/66\\/6\\/3222\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">UCLA study<\\/a>\\u00a0found that capsaicin inhibited the growth of prostate cancer cells in mice while leaving healthy cells unharmed.<\\/span><\\/p><h1><span style=\\\"color: #e8ebeb;\\\">5. Spices help kill bacteria<\\/span><\\/h1><p><span style=\\\"color: #ffffff;\\\">Cumin and turmeric have been shown to have\\u00a0powerful antioxidant and antimicrobial properties. This means they can be used against harmful bacteria in the body.<\\/span><\\/p><p>\\u200b<\\/p>\",\"align\":\"center\",\"text_color\":\"#ffffff\",\"typography_typography\":\"custom\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":true},{\"id\":\"1ddceed\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":59.035},\"elements\":[{\"id\":\"1b9502d\",\"elType\":\"widget\",\"settings\":{\"space\":{\"unit\":\"px\",\"size\":244,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"spacer\"},{\"id\":\"7b72f92\",\"elType\":\"widget\",\"settings\":{\"title\":\"STILL WONDERING IF YOU SHOULD TRY OUR SPICY FOOD? \",\"align\":\"center\",\"title_color\":\"#ffffff\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"px\",\"size\":45,\"sizes\":[]},\"text_shadow_text_shadow_type\":\"yes\",\"text_shadow_text_shadow\":{\"horizontal\":4,\"vertical\":4,\"blur\"