gba(0,0,0,0.5)\"},\"heading_visibility\":\"\",\"background_ypos\":{\"unit\":\"px\",\"size\":-181,\"sizes\":[]},\"css_filters_css_filter\":\"custom\",\"column_position\":\"top\",\"background_attachment\":\"fixed\",\"css_filters_brightness\":{\"unit\":\"px\",\"size\":200,\"sizes\":[]},\"margin\":{\"unit\":\"px\",\"top\":\"080\",\"right\":0,\"bottom\":\"110\",\"left\":0,\"isLinked\":false},\"background_overlay_color_b\":\"rgba(147,88,4,0.11)\",\"background_overlay_gradient_angle\":{\"unit\":\"deg\",\"size\":60,\"sizes\":[]},\"padding_mobile\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false}},\"elements\":[{\"id\":\"76e6e31\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"cbf254c\",\"elType\":\"section\",\"settings\":{\"structure\":\"20\",\"margin_mobile\":{\"unit\":\"px\",\"top\":\"0\",\"right\":0,\"bottom\":\"0\",\"left\":0,\"isLinked\":true},\"padding_mobile\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0200\",\"left\":\"0\",\"isLinked\":false}},\"elements\":[{\"id\":\"bcdaa80\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":40.965,\"background_background\":\"classic\",\"background_color\":\"rgba(255,255,255,0.1)\",\"border_radius\":{\"unit\":\"px\",\"top\":\"50\",\"right\":\"50\",\"bottom\":\"50\",\"left\":\"50\",\"isLinked\":true}},\"elements\":[{\"id\":\"afbb404\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<h1>\\u00a0<\\/h1><h1><span style=\\\"color: #e8ebeb;\\\">1. Sp\\u200bicy food has longevity benefits<\\/span><\\/h1><p><span style=\\\"color: #ffffff;\\\">Eating spicy food six or seven days a week \\u2014 even just once a day \\u2014 lowered mortality rates by 14 percent.<\\/span><\\/p><h1><span style=\\\"color: #e8ebeb;\\\">2. Spicy food speeds up your metabolism<\\/span><\\/h1><p><span style=\\\"color: #ffffff;\\\">Data across numerous studies indicates that certain spices \\u2014 like cumin, cinnamon, turmeric, peppers, and chilies \\u2014 can raise your\\u00a0<a class=\\\"content-link\\\" style=\\\"color: #ffffff;\\\" href=\\\"https:\\/\\/www.cambridge.org\\/core\\/services\\/aop-cambridge-core\\/content\\/view\\/47FE7819B02B76438ED737020035E725\\/S0007114512001201a.pdf\\/acute_effects_of_mustard_horseradish_black_pepper_and_ginger_on_energy_expenditure_appetite_ad_libitum_energy_intake_an\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">metabolic resting rate<\\/a>\\u00a0and\\u00a0<a class=\\\"content-link\\\" style=\\\"color: #ffffff;\\\" href=\\\"http:\\/\\/www.sciencedirect.com\\/science\\/article\\/pii\\/S0031938410004063?via%3Dihub\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">slow down your appetite<\\/a>.\\u00a0<\\/span><\\/p><h1><span style=\\\"color: #e8ebeb;\\\">3. Spices combat inflammation<\\/span><\\/h1><p><span style=\\\"color: #ffffff;\\\">Curcumin, a compound in turmeric,\\u00a0<a class=\\\"content-link\\\" style=\\\"color: #ffffff;\\\" href=\\\"https:\\/\\/www.ncbi.nlm.nih.gov\\/pmc\\/articles\\/PMC3400101\\/\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">may reduce inflammation in the body.<\\/a><\\/span><\\/p><h1><span style=\\\"color: #e8ebeb;\\\">4. Spices may even help fight cancer cells<\\/span><\\/h1><p><span style=\\\"color: #ffffff;\\\">Capsaicin, an active component of chili peppers, has been shown to slow and destroy cancer cells. A\\u00a0<a class=\\\"content-link\\\" style=\\\"color: #ffffff;\\\" href=\\\"http:\\/\\/cancerres.aacrjournals.org\\/content\\/66\\/6\\/3222\\\" target=\\\"_blank\\\" rel=\\\"noopener noreferrer\\\">UCLA study<\\/a>\\u00a0found that capsaicin inhibited the growth of prostate cancer cells in mice while leaving healthy cells unharmed.<\\/span><\\/p><h1><span style=\\\"color: #e8ebeb;\\\">5. Spices help kill bacteria<\\/span><\\/h1><p><span style=\\\"color: #ffffff;\\\">Cumin and turmeric have been shown to have\\u00a0powerful antioxidant and antimicrobial properties. This means they can be used against harmful bacteria in the body.<\\/span><\\/p><p>\\u200b<\\/p>\",\"align\":\"center\",\"text_color\":\"#ffffff\",\"typography_typography\":\"custom\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":true},{\"id\":\"1ddceed\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":59.035},\"elements\":[{\"id\":\"1b9502d\",\"elType\":\"widget\",\"settings\":{\"space\":{\"unit\":\"px\",\"size\":244,\"sizes\":[]},\"space_mobile\":{\"unit\":\"px\",\"size\":10,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"spacer\"},{\"id\":\"7b72f92\",\"elType\":\"widget\",\"settings\":{\"title\":\"STILL WONDERING IF YOU SHOULD TRY OUR SPICY FOOD? \",\"align\":\"center\",\"title_color\":\"#ffffff\",\"typography_typography\":\"custom\",\"typography_font_size\":{\"unit\":\"px\",\"size\":45,\"sizes\":[]},\"text_shadow_text_shadow_type\":\"yes\",\"text_shadow_text_shadow\":{\"horizontal\":4,\"vertical\":4,\"blur\":4,\"color\":\"#000000\"},\"_background_background\":\"classic\",\"_background_color\":\"rgba(255,255,255,0.18)\",\"_border_radius\":{\"unit\":\"px\",\"top\":\"25\",\"right\":\"25\",\"bottom\":\"25\",\"left\":\"25\",\"isLinked\":true},\"typography_font_size_mobile\":{\"unit\":\"px\",\"size\":26,\"sizes\":[]},\"_margin_mobile\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false},\"_padding_mobile\":{\"unit\":\"px\",\"top\":\"0\",\"right\":\"0\",\"bottom\":\"0\",\"left\":\"0\",\"isLinked\":false}},\"elements\":[],\"widgetType\":\"heading\"}],\"isInner\":true}],\"isInner\":true}],\"isInner\":false}],\"isInner\":false},{\"id\":\"9075c34\",\"elType\":\"section\",\"settings\":{\"structure\":\"20\"},\"elements\":[{\"id\":\"c2dbb46\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"6a609c9\",\"elType\":\"widget\",\"settings\":{\"space\":{\"unit\":\"px\",\"size\":63,\"sizes\":[]},\"space_mobile\":{\"unit\":\"px\",\"size\":10,\"sizes\":[]}},\"elements\":[],\"widge