(8, 1, '2019-05-24 13:46:33', '2019-05-24 12:46:33', '<p>el restorán de picante</p>		\n			<h1>WE SERVE AND MAKE BEST QUALITY FOOD DIRECTLY FROM OUR ORGANIC FARM </h1>		\n				<figure><a href=\"http://localhost/wp-2/food/\" data-elementor-open-lightbox=\"\" data-elementor-lightbox-slideshow=\"31fb76c\" data-elementor-lightbox-index=\"0\"><img src=\"http://localhost/wp-2/wp-content/uploads/elementor/thumbs/meat-1440105_1920-o8aquwgn5og1jq1thqtjb66s1h1zj5co760n0vylqg.jpg\" alt=\"Grilled kebabs\" /></a><figcaption>Grilled kebabs</figcaption></figure><figure><a href=\"http://localhost/wp-2/food/\" data-elementor-open-lightbox=\"\" data-elementor-lightbox-slideshow=\"31fb76c\" data-elementor-lightbox-index=\"1\"><img src=\"http://localhost/wp-2/wp-content/uploads/elementor/thumbs/grilled-pineapple-pork-burrito-2944562_1920-o8aqtftoiyfzhk6a142ffjgyrw9fk3jpbxhg5e4new.jpg\" alt=\"Grilled pineapple-pork burrito\" /></a><figcaption>Grilled pineapple-pork burrito</figcaption></figure><figure><a href=\"http://localhost/wp-2/food/\" data-elementor-open-lightbox=\"\" data-elementor-lightbox-slideshow=\"31fb76c\" data-elementor-lightbox-index=\"2\"><img src=\"http://localhost/wp-2/wp-content/uploads/elementor/thumbs/jause-338498_1920-o8aqh0ei5tfhz686lqo0godk0hips67gyeybpok1oo.jpg\" alt=\"200$\" /></a><figcaption>Tasty plate</figcaption></figure><figure><a href=\"http://localhost/wp-2/food/\" data-elementor-open-lightbox=\"\" data-elementor-lightbox-slideshow=\"31fb76c\" data-elementor-lightbox-index=\"3\"><img src=\"http://localhost/wp-2/wp-content/uploads/elementor/thumbs/rice-meat-3624533_1920-o8ay9btsb55wcr1tqwqo1xu9l7vdan1q5uv80cxe2w.jpg\" alt=\"rice-meat-3624533_1920\" /></a><figcaption>Hot rice meat</figcaption></figure><figure><a href=\"http://localhost/wp-2/food/\" data-elementor-open-lightbox=\"\" data-elementor-lightbox-slideshow=\"31fb76c\" data-elementor-lightbox-index=\"4\"><img src=\"http://localhost/wp-2/wp-content/uploads/elementor/thumbs/fried-chicken-690039_1920-o8ay9xg2obzhrs6f8o335adv92wt7ofjwtve1q1c3s.jpg\" alt=\"Fried chicken\" /></a><figcaption>Spicy fried chicken</figcaption></figure>			\n		<h1> </h1><h1>1. Sp​icy food has longevity benefits</h1><p>Eating spicy food six or seven days a week — even just once a day — lowered mortality rates by 14 percent.</p><h1>2. Spicy food speeds up your metabolism</h1><p>Data across numerous studies indicates that certain spices — like cumin, cinnamon, turmeric, peppers, and chilies — can raise your <a style=\"color: #ffffff;\" href=\"https://www.cambridge.org/core/services/aop-cambridge-core/content/view/47FE7819B02B76438ED737020035E725/S0007114512001201a.pdf/acute_effects_of_mustard_horseradish_black_pepper_and_ginger_on_energy_expenditure_appetite_ad_libitum_energy_intake_an\" target=\"_blank\" rel=\"noopener noreferrer\">metabolic resting rate</a> and <a style=\"color: #ffffff;\" href=\"http://www.sciencedirect.com/science/article/pii/S0031938410004063?via%3Dihub\" target=\"_blank\" rel=\"noopener noreferrer\">slow down your appetite</a>. </p><h1>3. Spices combat inflammation</h1><p>Curcumin, a compound in turmeric, <a style=\"color: #ffffff;\" href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC3400101/\" target=\"_blank\" rel=\"noopener noreferrer\">may reduce inflammation in the body.</a></p><h1>4. Spices may even help fight cancer cells</h1><p>Capsaicin, an active component of chili peppers, has been shown to slow and destroy cancer cells. A <a style=\"color: #ffffff;\" href=\"http://cancerres.aacrjournals.org/content/66/6/3222\" target=\"_blank\" rel=\"noopener noreferrer\">UCLA study</a> found that capsaicin inhibited the growth of prostate cancer cells in mice while leaving healthy cells unharmed.</p><h1>5. Spices help kill bacteria</h1><p>Cumin and turmeric have been shown to have powerful antioxidant and antimicrobial properties. This means they can be used against harmful bacteria in the body.</p><p>​</p>		\n			<h2>STILL WONDERING IF YOU SHOULD TRY OUR SPICY FOOD? </h2>		\n		<p>Come at our place to taste spicy food and return lost fire to your soul </p>		\n				<figure><img src=\"http://localhost/wp-2/wp-content/uploads/2019/05/chili-1995689_1920.jpg\" alt=\"chili-1995689_1920\" /></figure><figure><img src=\"http://localhost/wp-2/wp-content/uploads/2019/05/tabasco-1754420_1920.jpg\" alt=\"tabasco-1754420_1920\" /></figure><figure><img src=\"http://localhost/wp-2/wp-content/uploads/2019/05/masala-4096891_1920.jpg\" alt=\"masala-4096891_1920\" /></figure><figure><img src=\"http://localhost/wp-2/wp-content/uploads/2019/05/display-table-3748817_1920.jpg\" alt=\"display-table-3748817_1920\" /></figure><figure><img src=\"http://localhost/wp-2/wp-content/uploads/2019/05/chili-con-carne-378952_1920.jpg\" alt=\"chili-con-carne-378952_1920\" /></figure>			\n			<h2>WE EARNED 5 STARS FROM MICHELIN STAR SYSTEM FOR TOP CLASS EATERIE</h2>		\n						<i>&#61445;</i><i>&#61445;</i><i>&#61445;</i><i>&#61445;</i><i>&#61445;</i> 5/5', 'Home', '', 'publish', 'closed', 'closed', '', 'home', '', '', '2019-06-03 17:04:43', '2019-06-03 16:04:43', '', 0, 'http://localhost/wp-2/?page_id=8', 0, 'page', '', 0),
