 Thanks for making the evening an unforgettable one.\n							<img width=\"291\" height=\"291\" src=\"http://localhost/wp-2/wp-content/uploads/2019/05/25388788904_72d2f5ec6f_z.jpg\" alt=\"\" srcset=\"http://localhost/wp-2/wp-content/uploads/2019/05/25388788904_72d2f5ec6f_z.jpg 291w, http://localhost/wp-2/wp-content/uploads/2019/05/25388788904_72d2f5ec6f_z-150x150.jpg 150w\" sizes=\"(max-width: 291px) 100vw, 291px\" />						\n													Sandra Files\n			<h3>Tasty Breakfast</h3>		\n		<p>I am text block. Click edit button to change this text. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut elit tellus, luctus nec mattis pulvinar </p>		\n				<figure><img src=\"http://localhost/wp-2/wp-content/uploads/elementor/thumbs/foodiesfeed.com_traditional-czech-honey-cake-caffee-latte-o8aqd3ei95j11547sfyvzelggrjb4pqn961c54feqg.jpg\" alt=\"foodiesfeed.com_traditional-czech-honey-cake-caffee-latte.jpg\" /></figure><figure><img src=\"http://localhost/wp-2/wp-content/uploads/elementor/thumbs/foodiesfeed.com_Wedding_15-o8aqd5a6mtllod1hhgs54e4dnja1k3y3xfcb3ocme0.jpg\" alt=\"foodiesfeed.com_Wedding_15.jpg\" /></figure>			\n			<h3>Birthdays & Events</h3>		\n		<p>I am text block. Click edit button to change this text. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut elit tellus, luctus nec mattis pulvinar </p>		\n			<h3>Fresh Coffee</h3>		\n		<p>I am text block. Click edit button to change this text. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Ut elit tellus, luctus nec mattis pulvinar </p>https://www.youtube.com/watch?v=XHOmBV4js_E		\n			<h2>Our Sweets Collection</h2>		\n		<p>The best way to experience our wide collection of sweets is to visit the store. Follow the aromas and choose the most enticing sweets to satisfy your palate.</p>		\n				<figure><img src=\"http://localhost/wp-2/wp-content/uploads/elementor/thumbs/foodiesfeed.com_homemade-waffles-with-coffee-o8aqd3ehegd6ml013k5ldvwlibinayaxktj0md6dac.jpg\" alt=\"foodiesfeed.com_homemade-waffles-with-coffee.jpg\" /></figure><figure><img src=\"http://localhost/wp-2/wp-content/uploads/elementor/thumbs/foodiesfeed.com_traditional-czech-honey-cake-caffee-latte-o8aqd3ehegd6ml013k5ldvwlibinayaxktj0md6dac.jpg\" alt=\"foodiesfeed.com_traditional-czech-honey-cake-caffee-latte.jpg\" /></figure><figure><img src=\"http://localhost/wp-2/wp-content/uploads/elementor/thumbs/foodiesfeed.com_homemade-pizza-o8aqd5a5s4fr9sxaskyuivfip39dqcie92tzkx3kxw.jpg\" alt=\"foodiesfeed.com_homemade-pizza.jpg\" /></figure><figure><img src=\"http://localhost/wp-2/wp-content/uploads/elementor/thumbs/foodiesfeed.com_Wedding_15-o8aqd5a5s4fr9sxaskyuivfip39dqcie92tzkx3kxw.jpg\" alt=\"foodiesfeed.com_Wedding_15.jpg\" /></figure><figure><img src=\"http://localhost/wp-2/wp-content/uploads/elementor/thumbs/foodiesfeed.com_Your-Sunny-Side-Up-2-o8aqd2gn7mbwaz1e91qyte54wxna39778ovj537rgk.jpg\" alt=\"foodiesfeed.com_Your-Sunny-Side-Up-2.jpg\" /></figure>			\n			<a href=\"#\" role=\"button\">\n						More Sweets\n					</a>\n			<h2>Visit Us</h2>		\n					<ul>\n							<li >\n										1123 4rd St. San Francisco, CA 66507\n									</li>\n								<li >\n										reservation@domain.com\n									</li>\n								<li >\n										(315) 435 77 16\n									</li>\n								<li >\n										(315) 435 77 33\n									</li>\n						</ul>\n			<iframe frameborder=\"0\" scrolling=\"no\" marginheight=\"0\" marginwidth=\"0\" src=\"https://maps.google.com/maps?q=London%20Eye%2C%20London%2C%20United%20Kingdom&amp;t=m&amp;z=10&amp;output=embed&amp;iwloc=near\" aria-label=\"London Eye, London, United Kingdom\"></iframe>		\n		<p>Image Sources: <a href=\"https://foodiesfeed.com\">foodiesfeed</a>, <a href=\"http://www.wocintechchat.com\">WOCinTechChat</a>, <a href=\"http://www.graphberry.com/item/3-vintage-vector-logo-insignias\">GraphBerry</a></p>', 'Home', '', 'inherit', 'closed', 'closed', '', '8-revision-v1', '', '', '2019-05-24 16:16:29', '2019-05-24 15:16:29', '', 8, 'http://localhost/wp-2/8-revision-v1/', 0, 'revision', '', 0)