(85, 1, '2019-05-25 16:37:32', '2019-05-25 15:37:32', '<p>el restorán de picante</p>		\n			<h1>WE SERVE AND MAKE BEST QUALITY FOOD DIRECTLY FROM OUR ORGANIC FARM </h1>		\n				<figure><img src=\"http://localhost/wp-2/wp-content/uploads/elementor/thumbs/meat-1440105_1920-o8aquwgn5og1jq1thqtjb66s1h1zj5co760n0vylqg.jpg\" alt=\"meat-1440105_1920\" /></figure><figure><img src=\"http://localhost/wp-2/wp-content/uploads/elementor/thumbs/grilled-pineapple-pork-burrito-2944562_1920-o8aqtftoiyfzhk6a142ffjgyrw9fk3jpbxhg5e4new.jpg\" alt=\"grilled-pineapple-pork-burrito-2944562_1920\" /></figure><figure><img src=\"http://localhost/wp-2/wp-content/uploads/elementor/thumbs/jause-338498_1920-o8aqh0ei5tfhz686lqo0godk0hips67gyeybpok1oo.jpg\" alt=\"jause-338498_1920\" /></figure><figure><img src=\"http://localhost/wp-2/wp-content/uploads/elementor/thumbs/rice-meat-3624533_1920-o8ay9btsb55wcr1tqwqo1xu9l7vdan1q5uv80cxe2w.jpg\" alt=\"rice-meat-3624533_1920\" /></figure><figure><img src=\"http://localhost/wp-2/wp-content/uploads/elementor/thumbs/fried-chicken-690039_1920-o8ay9xg2obzhrs6f8o335adv92wt7ofjwtve1q1c3s.jpg\" alt=\"fried-chicken-690039_1920\" /></figure>			\n		<h2>1. Spicy food has longevity benefits</h2><p>Eating spicy food six or seven days a week — even just once a day — lowered mortality rates by 14 percent.</p><h2>2. Spicy food speeds up your metabolism</h2><p>Data across numerous studies indicates that certain spices — like cumin, cinnamon, turmeric, peppers, and chilies — can raise your <a href=\"https://www.cambridge.org/core/services/aop-cambridge-core/content/view/47FE7819B02B76438ED737020035E725/S0007114512001201a.pdf/acute_effects_of_mustard_horseradish_black_pepper_and_ginger_on_energy_expenditure_appetite_ad_libitum_energy_intake_an\" target=\"_blank\" rel=\"noopener noreferrer\">metabolic resting rate</a> and <a href=\"http://www.sciencedirect.com/science/article/pii/S0031938410004063?via%3Dihub\" target=\"_blank\" rel=\"noopener noreferrer\">slow down your appetite</a>. </p><h2>3. Spices combat inflammation</h2><p>Curcumin, a compound in turmeric, <a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC3400101/\" target=\"_blank\" rel=\"noopener noreferrer\">may reduce inflammation in the body.</a></p><h2>4. Spices may even help fight cancer cells</h2><p>Capsaicin, an active component of chili peppers, has been shown to slow and destroy cancer cells. A <a href=\"http://cancerres.aacrjournals.org/content/66/6/3222\" target=\"_blank\" rel=\"noopener noreferrer\">UCLA study</a> found that capsaicin inhibited the growth of prostate cancer cells in mice while leaving healthy cells unharmed.</p><h2>5. Spices help kill bacteria</h2><p>Cumin and turmeric have been shown to have <a href=\"https://www.ncbi.nlm.nih.gov/pubmed/20492235\" target=\"_blank\" rel=\"noopener noreferrer\">powerful antioxidant and antimicrobial propertiesTrusted Source</a>. This means they can be used against harmful bacteria in the body.</p><p>​</p>		\n			<h2>STILL WONDERING IF YOU SHOULD TRY OUR SPICY FOOD? </h2>		\n		<p>Come at our place to taste spicy food and return lost fire to your soul </p>		\n				<figure><img src=\"http://localhost/wp-2/wp-content/uploads/2019/05/chili-1995689_1920.jpg\" alt=\"chili-1995689_1920\" /></figure><figure><img src=\"http://localhost/wp-2/wp-content/uploads/2019/05/tabasco-1754420_1920.jpg\" alt=\"tabasco-1754420_1920\" /></figure><figure><img src=\"http://localhost/wp-2/wp-content/uploads/2019/05/masala-4096891_1920.jpg\" alt=\"masala-4096891_1920\" /></figure><figure><img src=\"http://localhost/wp-2/wp-content/uploads/2019/05/display-table-3748817_1920.jpg\" alt=\"display-table-3748817_1920\" /></figure><figure><img src=\"http://localhost/wp-2/wp-content/uploads/2019/05/chili-con-carne-378952_1920.jpg\" alt=\"chili-con-carne-378952_1920\" /></figure>', 'Home', '', 'inherit', 'closed', 'closed', '', '8-revision-v1', '', '', '2019-05-25 16:37:32', '2019-05-25 15:37:32', '', 8, 'http://localhost/wp-2/8-revision-v1/', 0, 'revision', '', 0);
